def password_dict(filename):        file = open(filename,'r')        passwords = []    for line in file:        line = line.rstrip()        passwords.append(line)            weak=[]    medium=[]    strong=[]        for pw in passwords:        if pw.isnumeric() or pw.isalpha():            weak.append(pw)        else:            if len(pw) < 8:                medium.append(pw)            else:                strong.append(pw)        my_dict = {}    my_dict['Weak']=weak    my_dict['Medium']=medium    my_dict['Strong']=strong    return my_dictdef generate_password(dct):        weaks=dct['Weak']    weaks_new=[]        for i in range(len(weaks)):        if weaks[i].isalpha():            weaks_new.append(weaks[i] + str(len(weaks[i])))        elif weaks[i].isnumeric():            weaks_new.append(weaks[i] + 'comp')        else:            weaks_new.append(weaks[i])         tup_list=[]    for i in range(len(weaks_new)):        tup_list.append((weaks[i],weaks_new[i]))            return tup_list        def main():    filename = 'passwords.txt'    return_dict = password_dict(filename)    print(return_dict)        pairs = generate_password(return_dict)    print(pairs)        ################################################################ """DO NOT EDIT BELOW THIS LINE"""if __name__ == '__main__':    main()    